import java.util.HashSet;
import java.util.List;
import java.util.Set;

class Solution {
    public int minOperations(List<Integer> nums, int k) {
        Set<Integer> collected = new HashSet<>();
        int operations = 0;
        for (int i = nums.size() - 1; i >= 0; i--) {
            collected.add(nums.get(i));
            operations++;
            if (collected.size() == k) {
                return operations;
            }
        }
        // The problem statement guarantees a solution, so this return statement
        // might not be necessary, but it's here to satisfy the compiler.
        return operations;
    }
}
